import React, {Component} from 'react';


class App extends Component{
    render(){
        return(
            <div className='container-fluid page'>
                <div className='bg'>
                    
                    <div  className='' style={{backgroundColor:'#FFBB76AA', justifySelf:'center', textAlign:'center', height:'20vh'}}>
                        <img src='/image/2x/titre.png' alt='ParticipAct'  style={{width:'20vw', marginTop:'2em'}}/>
                        <div style={{padding:'2em', color:'#ffff', fontWeight:250, fontSize:20}}>Enim reprehenderit proident ut amet incididunt. Adipisicing et dolore do proident proident
                        </div>
                    </div>

                    <div style={{marginTop:'6em'}}>
                        
                        <button className='btn btnGen'>En savoir plus</button>
                        

                    </div>
                
                </div>
            </div>

        )
    }
}

export default App
